import React, { Component } from 'react';

class Skills extends Component {
    render() {
        return (
            <React.Fragment>
                <div className='container-fluid'>
                    <hr />
                    <h2 className='display-4'>My Skills</h2>
                    <p>I have no skills</p>
                    <hr />
                </div>
            </React.Fragment>
        );
    }
}

export default Skills;
